import { useContext } from "react";

import { CartContext } from "../../contexts/Cart.context";

import "./Checkout.scss";

const Checkout = () => {
  const { cartItems } = useContext(CartContext);
  return (
    <div>
      <h1>Checkout</h1>
      <div>
        {cartItems.map((item) => {
          const { name, quantity } = item;
          return (
            <div>
              <h2>{name}</h2>
              <span>{quantity}</span>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Checkout;
